package assignment5ForLoop;

public class Question12 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int row=1 ; row<=10 ; row++) {
			for(int column=1; column<=10 ; column++) {
				System.out.print(column*row + " ");
			}
			System.out.println();
		}
		
	}

}
